import React from 'react'
import axios from "axios"


function App() {
    const options = {
        url: 'http://localhost:3001/upload',
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json;charset=UTF-8'
        },
        data: {
            a: 10,
            b: 20
        }
    };

    axios(options)
        .then(response => {
            console.log(response.status);
        });

    return(

        <div>
                HI
        </div>
    )
}

export default App
